import React from 'react';//api
import { createRoot } from 'react-dom/client';//渲染页面的
import './style/base.less'
import App from './App'
import store from './store';
import { Provider } from 'react-redux';
import { createBrowserRouter, HashRouter, RouterProvider } from 'react-router-dom'



import Layout from './components/Layout/layout';
import FindMusic from './components/FindMusic/index';
import MyMusic from './components/MyMusic/index';
import FollowMusic from './components/FollowMusic/index';

const rootElement = document.getElementById('root');
const root = createRoot(rootElement);

const router = createBrowserRouter([
  {
    path: '/*',
    element: <Layout></Layout>,
    children: [
      {
        path: '',
        element: <FindMusic></FindMusic>
      },
      {
        path: 'find',
        element: <FindMusic></FindMusic>
      },
      {
        path: 'my',
        element: <MyMusic></MyMusic>
      },
      {
        path: 'follow',
        element: <FollowMusic></FollowMusic>
      }
    ]
  }
])


root.render(
  <Provider store={store}>
    <RouterProvider router={router}>{/**配置使用路由对象 */}
      {/* <App></App> */}
    </RouterProvider >
  </Provider>
);
